+  $('.dragBox').hide();
+
+  $('.dragShade').click(function() {
+    var sh = $(this);
+    if (sh.text() == '[-]') {
+      sh.empty().append('[+]');
+      var p = $(this).parent(); // header
+      var h = p.height();
+      var pp = p.parent(); // box
+      var nh = pp.height();
+      sh.attr('ph', nh);
+      p.next().hide();
+      pp.height(h+6);
+
+    } else {
+      var n = sh.parent().next();
+      var nh = sh.attr('ph');
+      var p = sh.parent().parent();
+      p.height(nh);
+      sh.empty().append('[-]');
+      n.show();
+    }
+  });
+
